import React from "react";
import Title from "../Title/Title";
import { useState } from "react";
import './History.css';

const History = ()=>{
   const dummy = [
    {
        title : "Cash" , 
        money : 500 , 
        sign : 1 , // 1 or zero
    },
    {
        title : "Cash" , 
        money : 500 , 
        sign : 1 , // 1 or zero
    }
   ]
   const [historyArry , sethistory]=useState(dummy);
   
   return (
      <div className="history">
        <Title value="History"/>
        <ul>
           <li>{historyArry}</li>
        </ul>
      </div>
   );
}

export default History;
